import React, { useState } from "react";
import { v4 as uuidv4 } from "uuid";

function NoteList() {
  const [notes, setNotes] = useState([
    {
      id: uuidv4(),
      text: "This is my first note!",
    },
    {
      id: uuidv4(),
      text: "This is my second note!",
    },
    {
      id: uuidv4(),
      text: "This is my third note!",
    },
  ]);

  return (
    <div>
      <h1>{notes}</h1>
    </div>
  );
}

export default NoteList;
